1956 Chinese Mosin with bayonet lug removed clean and ATI stock- $200; 

1953 Hungarian M44 with lug removed clean, refinished and STEEL BEDDED- $350; 

1923 Mosin Hex Receiver Ex-Dragoon, really clean, super shiny bore, as good as these rifles get- SOLD; 

Foremost 6600 which is a Mauser 98 commercial clone, 30-06, BEDDED- SOLD

German Mauser 98, 8mm, Timney Trigger, Walnut stock, Leupold scope mounts, new blue job- Sold

Remington model 511 .22 caliber, 2 clips- $225; 

Enfield No.1 Mk 3, .303 British, ATI stock, new blue job, 2 magazines, bore a little dark but shoots good- $350. 

No scopes offered with these guns. I have some ammunition that may go in the trade, slings and scope mounts but no scopes. Text me at REDACTED. Thanks.
